import { StyleSheet } from "react-native";

const style = StyleSheet.create({
    formContext:{
        width:"100%",
        height:"100%",
        bottom:0,
        backgroundColor:"#fff",
        alignItems:"center",
        marginTop:30,
        borderTopLeftRadius:30,
        borderTopRightRadius:30,
    },
    from:{
        width:"100%",
        height:"auto",
        marginTop:30,
        paddin:10,
    },
    formLabel:{
        color:"#00000",
        fontSize:18,
        paddingLeft:20,
    },
    input:{
        width:"90%",
        bordderRadius:50,
        backgroundColor:"#f6f6f6",
        height:40,
        margin:12,
        paddinLeft:10,
    },
    buttonCalculator:{
        borderRadius:50,
        alignItems:"center",
        justifyContent:"center",
        width:"90%",
        backgroundColor:"#ff0043",
        paddingTop:14,
        paddingBottom:14,
        marginLeft:12,
        marign:30,
    },
    textButtonCalculator:{
        fontSize:20,
        color:"#fffff",
    }
});
